INSERT INTO `cms_block` (`block_id`, `title`, `identifier`, `content`, `creation_time`, `update_time`, `is_active`) VALUES
(1, 'Footer Links', 'footer_links', '\n<ul>\n    <li><a href="{{store direct_url="about-magento-demo-store"}}">About Us</a></li>\n    <li><a href="{{store direct_url="customer-service"}}">Customer Service</a></li>\n<li class="last privacy"><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy</a></li>\r\n</ul>', '2015-09-02 07:18:02', '2015-09-02 07:18:03', 1),
(2, 'Footer Links Company', 'footer_links_company', '<div class="links">\r\n<div class="block-title"><strong><span>Company</span></strong></div>\r\n<ul>\r\n<li><a href="{{store url=""}}about/">About Us</a></li>\r\n<li><a href="{{store url=""}}our-vision/">Our Vision</a></li>\r\n<li><a href="{{store url=""}}our-management/">Our Management</a></li>\r\n<li><a href="{{store url=""}}career/">Career</a></li>\r\n</ul>\r\n</div>', '2015-09-02 07:18:03', '2015-09-14 11:55:46', 1),
(3, 'Cookie restriction notice', 'cookie_restriction_notice_block', '<p>This website requires cookies to provide all of its features. For more information on what data is contained in the cookies, please see our <a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">Privacy Policy page</a>. To accept cookies from this site, please click the Allow button below.</p>', '2015-09-02 07:18:03', '2015-09-02 07:18:03', 1),
(4, 'Useful Link', 'useful_link', '<div class="links">\r\n<div class="block-title"><strong><span>Useful Link</span></strong></div>\r\n<ul>\r\n<li><a href="{{store url=""}}terms-conditions/">Terms Conditions</a></li>\r\n<li><a href="{{store url=""}}privacy-policy/">Privacy Policy</a></li>\r\n<li><a href="{{store url=""}}customer-service/">Customer Service</a></li>\r\n<li><a href="{{store url=""}}contacts/">Contact Us</a></li>\r\n<li><a href="{{store url=""}}faq/">FAQ</a></li>\r\n</ul>\r\n</div>', '2015-09-10 09:11:15', '2015-09-14 12:17:55', 1),
(5, 'Our Office', 'our-office', '<div class="links">\r\n<div class="block-title"><strong><span>SHOP &amp; SMiLE</span></strong></div>\r\n<p>23/1, Dilu Road<br />New Eskaton, Dhaka-1000<br />For Help: Email Us<br />Cell No: +8801511884422,+8801511445544</p>\r\n</div>', '2015-09-14 12:15:07', '2015-09-14 12:17:00', 1);
