INSERT INTO `cms_page` (`page_id`, `title`, `root_template`, `meta_keywords`, `meta_description`, `identifier`, `content_heading`, `content`, `creation_time`, `update_time`, `is_active`, `sort_order`, `layout_update_xml`, `custom_theme`, `custom_root_template`, `custom_layout_update_xml`, `custom_theme_from`, `custom_theme_to`) VALUES
(1, '404 Not Found 1', 'two_columns_right', 'Page keywords', 'Page description', 'no-route', NULL, '\n<div class="page-title"><h1>Whoops, our bad...</h1></div>\n<dl>\n    <dt>The page you requested was not found, and we have a fine guess why.</dt>\n    <dd>\n        <ul class="disc">\n            <li>If you typed the URL directly, please make sure the spelling is correct.</li>\n            <li>If you clicked on a link to get here, the link is outdated.</li>\n        </ul>\n    </dd>\n</dl>\n<dl>\n    <dt>What can you do?</dt>\n    <dd>Have no fear, help is near! There are many ways you can get back on track with Magento Store.</dd>\n    <dd>\n        <ul class="disc">\n            <li><a href="#" onclick="history.go(-1); return false;">Go back</a> to the previous page.</li>\n            <li>Use the search bar at the top of the page to search for your products.</li>\n            <li>Follow these links to get you back on track!<br /><a href="{{store url=""}}">Store Home</a>\n            <span class="separator">|</span> <a href="{{store url="customer/account"}}">My Account</a></li>\n        </ul>\n    </dd>\n</dl>\n', '2015-09-02 07:18:02', '2015-09-02 07:18:02', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 'Shop & Smile', 'one_column', NULL, NULL, 'home', NULL, '<div id="main-slider" class="row">\r\n<div class="col-sm-12">\r\n<div class="box">\r\n<div id="carousel-example-generic" class="carousel slide" data-ride="carousel"><!-- Indicators --> <!-- Wrapper for slides -->\r\n<div class="carousel-inner" role="listbox">\r\n<div class="item active"><img style="width: 100%;" alt="" src="{{skin url=''images/slide-1.png''}}" />\r\n<div class="carousel-caption">&nbsp;</div>\r\n</div>\r\n<div class="item"><img style="width: 100%;" alt="" src="{{skin url=''images/slide-2.png''}}" />\r\n<div class="carousel-caption">&nbsp;</div>\r\n</div>\r\n<div class="item"><img style="width: 100%;" alt="" src="{{skin url=''images/slide-3.png''}}" />\r\n<div class="carousel-caption">&nbsp;</div>\r\n</div>\r\n</div>\r\n<!-- Controls --> <a class="left carousel-control" role="button" href="#carousel-example-generic" data-slide="prev"> <span class="sr-only">Previous</span> </a> <a class="right carousel-control" role="button" href="#carousel-example-generic" data-slide="next"> <span class="sr-only">Next</span> </a></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class="category-div">\r\n<div class="row">\r\n<div class="col-sm-12">\r\n<div id="left-nav-title">Exclusive Sarees</div>\r\n</div>\r\n<div class="col-sm-12">{{block type="catalog/navigation" name="catalog.categories" template="catalog/navigation/exclusive_sarees.phtml"}}</div>\r\n</div>\r\n</div>\r\n<div class="category-div">\r\n<div class="row">\r\n<div class="col-sm-12">\r\n<div id="left-nav-title">Three Piece</div>\r\n</div>\r\n<div class="col-sm-12">{{block type="catalog/navigation" name="catalog.categories" template="catalog/navigation/three_pieces.phtml"}}</div>\r\n</div>\r\n</div>\r\n<div class="category-div">\r\n<div class="row">\r\n<div class="col-sm-12">\r\n<div id="left-nav-title">Original Branded Cosmetics</div>\r\n</div>\r\n<div class="col-sm-12">{{block type="catalog/navigation" name="catalog.categories" template="catalog/navigation/branded_cosmetics.phtml"}}</div>\r\n</div>\r\n</div>\r\n<div class="category-div">\r\n<div class="row">\r\n<div class="col-sm-12">\r\n<div id="left-nav-title">Ornaments</div>\r\n</div>\r\n<div class="col-sm-12">{{block type="catalog/navigation" name="catalog.categories" template="catalog/navigation/ornaments.phtml"}}</div>\r\n</div>\r\n</div>\r\n<div class="category-div">\r\n<div class="row">\r\n<div class="col-sm-12">\r\n<div id="left-nav-title">Fashionable Bags</div>\r\n</div>\r\n<div class="col-sm-12">{{block type="catalog/navigation" name="catalog.categories" template="catalog/navigation/fashionable_bag.phtml"}}</div>\r\n</div>\r\n</div>\r\n<div class="category-div">\r\n<div class="row">\r\n<div class="col-sm-12">\r\n<div id="left-nav-title">Branded Mobiles &amp; Gadgets</div>\r\n</div>\r\n<div class="col-sm-12">{{block type="catalog/navigation" name="catalog.categories" template="catalog/navigation/mobile_gadget.phtml"}}</div>\r\n</div>\r\n</div>\r\n<div class="category-div">\r\n<div class="row">\r\n<div class="col-sm-12">\r\n<div id="left-nav-title">Branded Wrist Watch</div>\r\n</div>\r\n<div class="col-sm-12">{{block type="catalog/navigation" name="catalog.categories" template="catalog/navigation/wrist_watch.phtml"}}</div>\r\n</div>\r\n</div>', '2015-09-02 07:18:02', '2015-09-19 06:08:53', 1, 0, '<!--<reference name="content">\r\n        <block type="catalog/product_new" name="home.catalog.product.new" alias="product_new" template="catalog/product/new.phtml" after="cms_page">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type="reports/product_viewed" name="home.reports.product.viewed" alias="product_viewed" template="reports/home_product_viewed.phtml" after="product_new">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type="reports/product_compared" name="home.reports.product.compared" template="reports/home_product_compared.phtml" after="product_viewed">\r\n            <action method="addPriceBlockType">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n    </reference>\r\n    <reference name="right">\r\n        <action method="unsetChild"><alias>right.reports.product.viewed</alias></action>\r\n        <action method="unsetChild"><alias>right.reports.product.compared</alias></action>\r\n    </reference>-->', NULL, NULL, NULL, NULL, NULL),
(3, 'About Us', 'two_columns_right', NULL, NULL, 'about', NULL, '<p><a href="http://www.shopndsmile.com/">www.shopndsmile.com</a>&nbsp;is a trusted &amp; most reliable online shop in Bangladesh which started its operation with the slogan -"Shop, Save &amp; Keep Smiling". We are committed to deliver a wealth of choice, the best quality products &amp; world class services at the lowest possible price to meet the expectations &amp; ensure satisfaction of our valued customers.</p>\r\n<p><a href="http://www.shopndsmile.com/">www.shopndsmile.com</a>&nbsp;is presently selling Exclusive Jamdani Sarees, Tangail Sarees, Branded fashionable dresses from reputed foreign companies, Fashionable hand Bags, Jewelry, Electronics, Branded Mobile Phone sets and accessories, Original Cosmetics, Electronics, Gift items etc. We have the plan to sell A-Z products step by step for the online shoppers both for domestic and international market.&nbsp;<b>SHOP &amp; SMiLE</b>&nbsp;is committed to brig fashion forward, trend driven, stylish and best quality products for our clients.</p>\r\n<p class="font8"><b>SHOP &amp; SMiLE&nbsp;</b>ensures-&nbsp;</p>\r\n<ul>\r\n<li>Best quality products and services</li>\r\n<li>We offer the best price in the market</li>\r\n<li>On time &amp; free home delivery</li>\r\n<li>Guaranteed Customer&rsquo;<span>s</span>&nbsp;Satisfaction&nbsp;</li>\r\n</ul>\r\n<p class="font8">As&nbsp;<b>SHOP &amp; SMiLE</b>&nbsp;is committed to offer best products and services for our customers, so whatever we do we do with our utmost sincerity. We like to achieve operational excellence in every phase of our operations from product sourcing to aftersales services.&nbsp;<b>SHOP &amp; SMiLE</b>&nbsp;undertake appropriate review of our business process and activities in regular basis to retain consistent customer&rsquo;s satisfaction and overall growth and success of the organization.</p>\r\n<p class="font7">You can enjoy reliable, convenient and hassle free online shopping at&nbsp;<a href="http://www.shopndsmile.com/">www.shopndsmile.com</a>&nbsp;. Wherever you reside either in the mega city of Dhaka or any remotest area of this country; we deliver your desired products at your doorstep through our trusted and reliable courier partners. If your purchased product doesn&rsquo;t match your exact size, we will replace your product immediately with the right sized.&nbsp; You can buy our products by using your debit or credit card or by using your bikash account. If you feel hazard, you can take the advantage of our Cash on Delivery System (condition apply).</p>\r\n<p class="font8">As a valued customer you don&rsquo;t need to be worried regarding the quality of the products we offer because&nbsp;<b>SHOP &amp; SMiLE</b>&nbsp;always follow the standard procedures to collect, store and to deliver the best products at your doorstep. Despite giving our sincere effort if any complaints raise from any corner we take immediate actions and resolve it within 1-5 working days.</p>\r\n<p><b>SHOP &amp; SMiLE</b>&nbsp;is run by the most dedicated and professional team to provide you the best quality products and services. A group of creative, talented, well trained and skilled people are working together to satisfy the need of our valued customers.&nbsp;</p>', '2015-09-02 07:18:03', '2015-09-04 10:38:05', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(4, 'Customer Service', 'three_columns', NULL, NULL, 'customer-service', NULL, '<p>Coming soon</p>', '2015-09-02 07:18:03', '2015-09-04 10:50:44', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(5, 'Enable Cookies', 'one_column', NULL, NULL, 'enable-cookies', NULL, '<div class="std">\n    <ul class="messages">\n        <li class="notice-msg">\n            <ul>\n                <li>Please enable cookies in your web browser to continue.</li>\n            </ul>\n        </li>\n    </ul>\n    <div class="page-title">\n        <h1><a name="top"></a>What are Cookies?</h1>\n    </div>\n    <p>Cookies are short pieces of data that are sent to your computer when you visit a website.\n    On later visits, this data is then returned to that website. Cookies allow us to recognize you automatically\n    whenever you visit our site so that we can personalize your experience and provide you with better service.\n    We also use cookies (and similar browser data, such as Flash cookies) for fraud prevention and other purposes.\n     If your web browser is set to refuse cookies from our website, you will not be able to complete a purchase\n     or take advantage of certain features of our website, such as storing items in your Shopping Cart or\n     receiving personalized recommendations. As a result, we strongly encourage you to configure your web\n     browser to accept cookies from our website.</p>\n    <h2 class="subtitle">Enabling Cookies</h2>\n    <ul class="disc">\n        <li><a href="#ie7">Internet Explorer 7.x</a></li>\n        <li><a href="#ie6">Internet Explorer 6.x</a></li>\n        <li><a href="#firefox">Mozilla/Firefox</a></li>\n        <li><a href="#opera">Opera 7.x</a></li>\n    </ul>\n    <h3><a name="ie7"></a>Internet Explorer 7.x</h3>\n    <ol>\n        <li>\n            <p>Start Internet Explorer</p>\n        </li>\n        <li>\n            <p>Under the <strong>Tools</strong> menu, click <strong>Internet Options</strong></p>\n            <p><img src="{{skin url="images/cookies/ie7-1.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Click the <strong>Privacy</strong> tab</p>\n            <p><img src="{{skin url="images/cookies/ie7-2.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Click the <strong>Advanced</strong> button</p>\n            <p><img src="{{skin url="images/cookies/ie7-3.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Put a check mark in the box for <strong>Override Automatic Cookie Handling</strong>,\n            put another check mark in the <strong>Always accept session cookies </strong>box</p>\n            <p><img src="{{skin url="images/cookies/ie7-4.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Click <strong>OK</strong></p>\n            <p><img src="{{skin url="images/cookies/ie7-5.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Click <strong>OK</strong></p>\n            <p><img src="{{skin url="images/cookies/ie7-6.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Restart Internet Explore</p>\n        </li>\n    </ol>\n    <p class="a-top"><a href="#top">Back to Top</a></p>\n    <h3><a name="ie6"></a>Internet Explorer 6.x</h3>\n    <ol>\n        <li>\n            <p>Select <strong>Internet Options</strong> from the Tools menu</p>\n            <p><img src="{{skin url="images/cookies/ie6-1.gif"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> tab</p>\n        </li>\n        <li>\n            <p>Click the <strong>Default</strong> button (or manually slide the bar down to <strong>Medium</strong>)\n            under <strong>Settings</strong>. Click <strong>OK</strong></p>\n            <p><img src="{{skin url="images/cookies/ie6-2.gif"}}" alt="" /></p>\n        </li>\n    </ol>\n    <p class="a-top"><a href="#top">Back to Top</a></p>\n    <h3><a name="firefox"></a>Mozilla/Firefox</h3>\n    <ol>\n        <li>\n            <p>Click on the <strong>Tools</strong>-menu in Mozilla</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Options...</strong> item in the menu - a new window open</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> selection in the left part of the window. (See image below)</p>\n            <p><img src="{{skin url="images/cookies/firefox.png"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>Expand the <strong>Cookies</strong> section</p>\n        </li>\n        <li>\n            <p>Check the <strong>Enable cookies</strong> and <strong>Accept cookies normally</strong> checkboxes</p>\n        </li>\n        <li>\n            <p>Save changes by clicking <strong>Ok</strong>.</p>\n        </li>\n    </ol>\n    <p class="a-top"><a href="#top">Back to Top</a></p>\n    <h3><a name="opera"></a>Opera 7.x</h3>\n    <ol>\n        <li>\n            <p>Click on the <strong>Tools</strong> menu in Opera</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Preferences...</strong> item in the menu - a new window open</p>\n        </li>\n        <li>\n            <p>Click on the <strong>Privacy</strong> selection near the bottom left of the window. (See image below)</p>\n            <p><img src="{{skin url="images/cookies/opera.png"}}" alt="" /></p>\n        </li>\n        <li>\n            <p>The <strong>Enable cookies</strong> checkbox must be checked, and <strong>Accept all cookies</strong>\n            should be selected in the &quot;<strong>Normal cookies</strong>&quot; drop-down</p>\n        </li>\n        <li>\n            <p>Save changes by clicking <strong>Ok</strong></p>\n        </li>\n    </ol>\n    <p class="a-top"><a href="#top">Back to Top</a></p>\n</div>\n', '2015-09-02 07:18:03', '2015-09-02 07:18:03', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(6, 'Privacy Policy', 'two_columns_right', NULL, NULL, 'privacy-policy', 'Privacy Policy', '<p><b>What are the delivery Policy of&nbsp;</b><a href="http://www.shopndsmile.com/">www.shopndsmile.com</a></p>\r\n<p><b>SHOP &amp; SMiLE</b>&nbsp;is committed to deliver your desired products at the earliest convenience. Our dedicated delivery team is working together to handover the product at your doorstep at the right time. We are working with our in-house delivery team and also with the reputed and reliable courier service form home and abroad to deliver the product within the stipulated time frame.</p>\r\n<p><b>Standard Delivery Time</b>: If delivery address is within Dhaka City your ordered will be delivered to your delivery address at the next working day. If the delivery address is out of Dhaka City in that case it may take 2-5 working days to deliver the products.&nbsp; If you place your order after 10pm it will be considered as the order of next business day and will be processed accordingly.&nbsp;</p>\r\n<p><b>Exception:</b>&nbsp;There are some products that we source form outside the country; in that case it may take 10 working days or more to reach you. But we are giving you the assurance that your desired product should be supplied within the stipulated time period.</p>\r\n<p><b>For International buyers:</b>&nbsp; For International buyers delivery time may vary from 3-10 days depending on the courier service and also their destination. We deliver products all over the world but in that case buyer has to pay the shipping + other charges if applicable. So you can buy products form us without any hesitation from any corner of the globe.</p>\r\n<p>Whether your location can be serviced or not depends on</p>\r\n<ul>\r\n<li>Availability of couriers service at your location</li>\r\n<li>Legal restrictions, if any in shipping particular products to your location</li>\r\n<li>The availability of reliable courier partners in your location</li>\r\n</ul>\r\n<p>At times we prefer not to ship to certain location, this is entirely the discretion of the organization because of the security reasons.</p>\r\n<p>Security Policy&nbsp;<b>SHOP &amp; SMiLE</b>:</p>\r\n<p><b>SHOP &amp; SMiLE</b>&nbsp;is committed to ensure the security of your information you provide to us. We secure your information by preventing unauthorized access. Cookies is a small file which asks permission to be place on your computer hard drive. Cookies allow web application to respond to you as an individual. The web application can tailor its operations to your needs, likes and dislikes by gathering and remembering information about your preferences.&nbsp;<b>SHOP &amp; SMiLE</b>&nbsp;only use this information for different statistical analysis and the data is revived form the system. A cookie in no way gives us access to your computer or any information about you, other than the data you chose to share with us.</p>', '2015-09-02 07:18:03', '2015-09-04 10:49:19', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(7, 'Faq', 'two_columns_right', NULL, NULL, 'faq', NULL, '<p><b>What is&nbsp;</b><a href="http://www.shopndsmile.com/"><b>www.shopndsmile.com</b></a><b>&nbsp;&nbsp;about?</b></p>\r\n<p><a href="http://www.shopndsmile.com/">www.shopndsmile.com</a>&nbsp;is the web address of&nbsp;<b>SHOP &amp; SMiLE</b>&nbsp;most trusted and reliable online shop in Bangladesh which started its operation with the slogan &ldquo;Shop, Save and Keep Smiling&rdquo;.&nbsp;<b>SHOP &amp; SMiLE&nbsp;</b>is the best online shopping destinations for the people of this country and around the globe. It is presently selling Exclusive Jamdani Sarees, Tangail Sarees, Branded fashionable dresses form reputed foreign companies, Fashionable hand Bags, Jewelry, Electronics, Branded Mobile Phone sets and accessories, Original Branded Cosmetics, Electronics, Gift items etc. Our vision is to become the largest online shop in the country by 2020. We are selling highest quality product at the lowest possible price.</p>\r\n<p><b>What are the advantages of joining shopndsmile.com?</b></p>\r\n<p>Being the registered member of&nbsp;<a href="http://www.shopndsmile.com/">www.shopndsmile.com</a>&nbsp; you can enjoy a complementary gift at your first purchase.&nbsp;<b>SHOP &amp; SMiLE&nbsp;</b>launches some special campaign only for its registered customers and you can enjoy these exclusive offers. It will also give you the opportunity for a hassle free shopping experience.</p>\r\n<p><b>How can I be a member of&nbsp;</b><a href="http://www.shopndsmile.com/"><b>www.shopndsmile.com</b></a><b>&nbsp;?</b></p>\r\n<p>It is very simple. Just visit our website and sign up for being the registered member of shopndsmile.com. Fill up the form with required information and submit it. You will be the registered member of shopndsmile.com. It is free of cost and you can edit your information at any time by login your account.</p>\r\n<p>What payment options are available on&nbsp;<a href="http://www.shopndsmile.com/">www.shopndsmile.com</a>&nbsp;?</p>\r\n<p>Shopping at shopndsmile.com is easy and enjoyable. For your convenience we accept different types of payment options such as Debit/Credit card, all Master/Visa card, Bikash, DBBL etc. If you feel Hazard you don&rsquo;t need to be worried, you can take the advantage of our Cash on Delivery System.</p>\r\n<p><b>How safe is to use my Debit/Credit card on shopndmsile.com?</b></p>\r\n<p>It is 100% secured because all online payments on shopndsmile.com are processed through reliable, secured and trusted payment gateway. When you make any transaction you pay to the payment gateway which is incorporated with your respective bank. Only Bank deals with your debit/credit card information. Moreover,&nbsp;<b>SHOP &amp; SMiLE&nbsp;</b>doesn&rsquo;t preserve any user card information. So, it is absolutely safe to use your credit/debit card. We maintain the highest standards of existing internet security system to ensure that your shopping is private, safe and secured.</p>\r\n<p><b>Does shopndsmsile.com protect user privacy?</b></p>\r\n<p>Yes we do.&nbsp;<b>SHOP &amp; SMiLE</b>&nbsp;implement a variety of privacy measures to maintain the safety and to protect user&rsquo;s privacy. We do never hand over your personal information to third party for any promotional work.&nbsp; We are committed to preserve your privacy, purchase history and your buying behavior.&nbsp;</p>\r\n<p><b>What kinds of products are listed on shopndsmile.com?</b></p>\r\n<p>You can purchase any kind of products through&nbsp;<a href="http://www.shopndsmile.com/">www.shopndsmile.com</a>. Presently our listed products are Exclusive Jamdani Sarees, Tangail Sarees, Branded fashionable dresses form reputed foreign companies, Fashionable hand Bags, Jewelry, Electronics, Branded Mobile Phone sets and accessories, Original Cosmetics, Electronics, Gift items etc. Very shortly&nbsp;<b>SHOP &amp; SMiLE</b>&nbsp;will expand the product diversity to deliver wealth of client choices for A-Z products both for domestic and international market.&nbsp;</p>\r\n<p><b>How can place order on shopndsmile.com?</b></p>\r\n<p>You can take the advantage of our online order placement system of&nbsp;<b>SHOP &amp; SMiLE</b>. You also can place your order by directly calling to our customer service managers or you can order your desired product by SMS or you can email us at&nbsp;<a href="mailto:info@shopndsmile.com">info@shopndsmile.com</a></p>\r\n<p><b>What are the standard delivery charges?</b></p>\r\n<p><b>SHOP &amp; SMiLE</b>&nbsp;deliver our products at free of cost at any corner of the country. But if you like to avail express delivery; you have to pay 100 Taka/delivery within the country. For our international buyers, you have to pay the delivery and other charges fixed by our courier partners.</p>\r\n<p><b>What is the estimated delivery time?</b></p>\r\n<p>If you submit your order within 10pm, the usual delivery time is the next working day within Dhaka city. Based on courier facilities available in the areas out of Dhaka, it may take 3-5 working days. If you submit order after 10pm, it will be processed as the order of next working day and will be treated accordingly. For international buyers, delivery time is 3-10 working days depending on your desired or available courier services to the country. There are some products that&nbsp;<b>SHOP &amp; SMiLE</b>&nbsp;source from outside the country; in that case it may take 10-15 working days.</p>\r\n<p><b>Does shopndsmile.com deliver products outside Bangladesh?</b></p>\r\n<p>Yes, we do,&nbsp;<b>SHOP &amp; SMiLE</b>&nbsp;gladly accept order form the international buyers. So you can place your order without any hesitation from around the globe but in that case buyers have to pay related shipping +other charges.</p>\r\n<p><b>How does shopndsmile.com maintain the quality of products and services?&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</b></p>\r\n<p><a href="http://www.shopndsmile.com/">www.shopndsmile.com</a>&nbsp;is a reliable and trusted name in Bangladesh ecommerce market. Our basic strength is quality of our products and services. Our vision is to emerge as a global company; so we always ensure the best quality products for our clients. Our quality assurance team is working constantly to ensure the quality of our products. We are uncompromising regarding the quality of products and services and we follow zero tolerance about it. So you can confidently shop at&nbsp;<a href="http://www.shopndsmile.com/">www.shopndsmile.com</a>&nbsp;&nbsp;without any hesitation.</p>\r\n<p>How can I contact shopndsmile.com if I have a question or complaint?</p>\r\n<p>This is very simple, you can reach shopndsmile.com by &ldquo;contact us&rdquo; page or you can raise your complaints or suggestions by calling to our Customer Services Managers at +8801511884422 from 9am-10pm or you can drop an email at&nbsp;<a href="mailto:care@shopndsmile.com">care@shopndsmile.com</a>.&nbsp;<b>SHOP &amp; SMiLE&nbsp;</b>appreciates your efforts for any comments, suggestions &amp; questions; and in case of any complaint we always takes it very sincerely &amp; get back to you immediately with its updates &amp; solutions.</p>\r\n<p><b>Are there any hidden charges when I make a purchase on&nbsp;</b><a href="http://www.shopndsmile.com/"><b>www.shopndsmile.com</b></a><b>&nbsp;?</b></p>\r\n<p>Absolutely not; there are no hidden charges when you make a purchase on&nbsp;<b>SHOP &amp; SMiLE</b>. The prices listed for all items are final and all inclusive. The price you see on the product page is exactly what you have to pay.</p>\r\n<p><b>What is COD?</b></p>\r\n<p>If you are not comfortable making an online payment, you can chose Cash on Delivery payment method (Condition apply). With Cash on Delivery you can pay in cash at the time of actual delivery of the product at your doorstep, without requiring you to make any advance payment online.</p>\r\n<p><b>How can I return an item purchased form&nbsp;</b><a href="http://www.shopndsmile.com/"><b>www.shopndsmile.com</b></a><b>&nbsp;?</b></p>\r\n<p><b>SHOP &amp; SMiLE&nbsp;</b>is committed to give you a hassle free enjoyable shopping experience. You can return an item if you have received an item in a &lsquo;Damaged&rsquo;&nbsp; &lsquo;Defective&rsquo; or &lsquo;Not as Described state&rsquo;. Please ensure that the product is in unused and original condition. Include everything from the package you have received including price tags, levels, original packing, freebies and accessories. Returns including all replacements/pickups are done at free of cost.</p>\r\n<p><b>What is the Replacement Guarantee of&nbsp;</b><a href="http://www.shopndsmile.com/"><b>www.shopndsmile.com</b></a><b>&nbsp;?</b></p>\r\n<p>Shop &amp; Smile send you the exact product what is displayed at our website. However, if your product doesn&rsquo;t fit you or doesn&rsquo;t match the exact color we replace the product immediately with the right sized and color with free of cost. Just call our customer are at 01511884422 or Drop an email at<a href="mailto:care@shopndsmile.com">care@shopndsmile.com</a>&nbsp;within a period of 3 days from the date of delivery in an unwashed and undamaged condition. Replacement of product is subject to inspection and checking by<b>&nbsp;SHOP &amp; SMiLE</b>&nbsp;team. Replacement would not be possible if the product is brunt, damaged by short circuit or broken by customer. Damages due to neglect, improper usages or application will not be covered under our Replacement Guarantee.</p>\r\n<p>How much time does it takes to get the product in hand if I place an order on&nbsp;<a href="http://www.shopndsmile.com/">www.shopndsmile.com</a>&nbsp;?</p>\r\n<p>Normally we deliver our products in the next working day within Dhaka City and 2-5 working days for out of Dhaka. For international buyers delivery time requires 07-10 working days. &nbsp;But delivery time may vary depending on some situation- product category, product availability and the destination to which you want the order shipped to and courier partner time to deliver in your location.</p>', '2015-09-04 10:41:34', '2015-09-04 10:41:34', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(8, 'Our Vision', 'two_columns_right', NULL, NULL, 'our-vision', 'Vision of SHOP & SMiLE', '<p class="font8"><b>Vision of SHOP &amp; SMiLE&nbsp;</b>(<a href="http://www.shopndsmile.com/">www.shopndsmile.com</a>&nbsp;)</p>\r\n<p class="font8">Our vision is to become the largest online shop in the country by 2020 through offering world class products and services at the lowest possible price for the online shoppers of the domestic and international market. Today we are a small venture but our ultimate objective is to become a global player.&nbsp;<b>SHOP &amp; SMiLE</b>&nbsp;has the plan to expand its business step by step in Retail Chain Shop, Healthcare, Education, Real-estate, Tourism, Food and Beverage Industry. &nbsp;</p>', '2015-09-04 10:44:55', '2015-09-04 10:44:55', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(9, 'Our Management', 'two_columns_right', NULL, NULL, 'our-management', 'Our Management', '<p><b>Management of&nbsp;</b><a href="http://www.shopndsmile.com/"><b>www.shopndsmile.com</b></a></p>\r\n<p><b>SHOP &amp; SMiLE</b>&nbsp;is run by very dedicated, professional and experienced management. Ms. Suparna Banik &amp; Ms. Susmita Banik jointly founded&nbsp;<a href="http://www.shopndsmile.com/">www.shopndsmile.com</a>&nbsp;with the Slogan &ldquo;Shop, Save &amp; Keep Smiling&rdquo;. Shop &amp; Smile is the most trusted and reliable ecommerce shop in Bangladesh which is committed to give you a hassle free shopping experience to online shoppers of Bangladesh and around the globe.</p>\r\n<p><b>MS. Suparna Banik</b></p>\r\n<p>Ms. Suparna Banik completed her Masters in English Literature from Rajshahi College. She also achieved Post Graduate Diploma in International Relationship from University of Dhaka. She participated at different training program on Communication &amp; Presentation Skills, Customer Services and E-Marketing, PIP, TOT etc. She started her career with a reputed Non-Profit Organization. She also got the opportunity to work with Electronic Media &amp; IT Industry. MS Suparna Banik has vast experience with Customer Service Management and presently working at Grameen Phone Ltd, the largest Telecommunication Company in Bangladesh.</p>\r\n<p><b>Ms. Susmita Banik</b></p>\r\n<p>Ms. Susmita Banik completed her Masters in Genetics and Plant Breeding form Bangabandhu Sheikh Mujibur Rahman Agriculture University. Ms. Susmita Banik also completed Graduation Diploma in Development Studies from University of Dhaka. She also achieved Post Graduate Diploma in International Relation from the Department of IR, University of Dhaka. She has an international publication on research work which was published form Germany. Ms. Banik participated and attended training, seminar and workshop organized by SAU, BSMRAU as well as UNIDO. She is the Member Secretary of a reputed Non-Profit Organization (NGO). She is also the member of Young Professionals for Agricultural Development-Bangladesh and Genetics and Plant Breeding Society of Bangladesh. She started her career with education sector and presently working with honor with a reputed sister concern of United Nations.</p>\r\n<p><b>Mr. Debojite Chandra Bhowmick</b></p>\r\n<p>Mr. Debojite Chandra Bhowmick completed MBA, Major in marketing form Canadian Scholl of Management and Institute of Graduate Studies (CSM&amp;IGS). He is serving as an honorary advisor of&nbsp;<a href="http://www.shopndsmile.com/">www.shopndsmile.com</a>. Mr. Bhowmick has twenty years of experiences in Marketing, Sales &amp; Training in Pharmaceuticals Industry. He has got the opportunity to work with Leading Pharmaceuticals Companies of Bangladesh. He started his career with Beximco Pharmaceuticals Ltd the 3<span>rd</span>&nbsp;largest pharmaceuticals company of this country. He also worked with Incepta Pharmaceuticals Ltd the 2<span>nd</span>&nbsp;largest pharmaceuticals company and presently working with the fastest growing pharmaceuticals of this country. He received lots of training on Strategic Marketing, Leadership &amp; Motivation, Sales Forces Effectiveness, Planning &amp; Resource Allocation, E-Marketing, Business English Language etc.&nbsp; from reputed foreign organization like IMS of USA, IBC Asia Pte of Singapore, TACK Training International of UK and British Council. &nbsp;</p>', '2015-09-04 10:47:08', '2015-09-04 10:47:08', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(10, 'Terms Conditions', 'two_columns_right', NULL, NULL, 'terms-conditions', 'Terms Conditions', '<p>Terms &amp; Condition &ndash; for using&nbsp;<a href="http://www.shopndsmile.com/">www.shopndsmile.com</a></p>\r\n<h3>In General</h3>\r\n<p><b>SHOP &amp; SMiLE</b>&nbsp;(www.shopndsmile.com) owns and operate this Website. &nbsp;This document governs your relationship with<a href="http://www.shopndsmile.com/">www.shopndsmile.com</a>. Access to and use of this Website and the products and services available through this Website are subject to the following terms, conditions and notices (the "Terms of Service"). By using the Services, you are agreeing to all of the Terms of Service, as may be updated by&nbsp;<b>SHOP &amp; SMiLE</b>&nbsp;from time to time. You should check this page regularly to take notice of any changes we may have made to the Terms of Service.</p>\r\n<p>Access to this&nbsp;<b>SHOP &amp; SMiLE</b>&nbsp;(<a href="http://www.shopndsmile.com/">www.shopndsmile.com</a>) is permitted on a temporary basis, and we reserve the right to withdraw or amend the Services without notice. We will not be liable if for any reason this Website is unavailable at any time or for any period. From time to time, we may restrict access to some parts or all of this Website.</p>\r\n<p><b>SHOP &amp; SMiLE</b>&nbsp;may contain links to other websites, which are not operated by&nbsp;<a href="http://www.shopndsmile.com/">www.shopndsmile.com</a>&nbsp;.&nbsp;<b>SHOP &amp; SMiLE</b>&nbsp;has no control over the Linked Sites and accepts no responsibility for them or for any loss or damage that may arise from your use of them. Your use of the Linked Sites will be subject to the terms of use and service contained within each such site.</p>\r\n<p>Privacy Policy</p>\r\n<p>Our privacy policy, which sets out how we will use your information, can be found at [Privacy Policy Link]. By using this Website, you consent to the processing described therein and warrant that all data provided by you is accurate.</p>\r\n<p>Prohibitions</p>\r\n<p>You must not misuse this Website. You will not: commit or encourage a criminal offense; transmit or distribute a virus, trojan, worm, logic bomb or any other material which is malicious, technologically harmful, in breach of confidence or in any way offensive or obscene; hack into any aspect of the Service; corrupt data; cause annoyance to other users; infringe upon the rights of any other person''s proprietary rights; send any unsolicited advertising or promotional material, commonly referred to as "spam"; or attempt to affect the performance or functionality of any computer facilities of or accessed through this Website. Breaching this provision would constitute a criminal offense and&nbsp;<a href="http://www.shopndsmile.com/">www.shopndsmile.com</a>&nbsp;will report any such breach to the relevant law enforcement authorities and disclose your identity to them.</p>\r\n<p><b>SHOP &amp; SMiLE</b>&nbsp;will not be liable for any loss or damage caused by a distributed denial-of-service attack, viruses or other technologically harmful material that may infect your computer equipment, computer programs, data or other proprietary material due to your use of this Website or to your downloading of any material posted on it, or on any website linked to it.</p>\r\n<p>Intellectual Property, Software and Content</p>\r\n<p>The intellectual property rights in all software and content (including photographic images) made available to you on or through this Website remains the property of&nbsp;<a href="http://www.shopndsmile.com/">www.shopndsmile.com</a>&nbsp;or its licensors and are protected by copyright laws and treaties around the world. All such rights are reserved by&nbsp;<a href="http://www.shopndsmile.com/">www.shopndsmile.com</a>&nbsp; and its licensors. You may store, print and display the content supplied solely for your own personal use. You are not permitted to publish, manipulate, distribute or otherwise reproduce, in any format, any of the content or copies of the content supplied to you or which appears on this Website nor may you use any such content in connection with any business or commercial enterprise.</p>\r\n<p>Terms of Sale</p>\r\n<p>By placing an order you are offering to purchase a product on and subject to the following terms and conditions. All orders are subject to availability and confirmation of the order price.</p>\r\n<p>Dispatch times may vary according to availability and subject to any delays resulting from postal delays or force majeure for which we will not be responsible.&nbsp;</p>\r\n<p>In order to contract with&nbsp;<a href="http://www.shopndsmile.com/">www.shopndsmile.com</a>&nbsp; you must be over 18 years of age and possess a valid credit or debit card issued by a bank acceptable to us, if you make any transaction other than that&nbsp;<b>SHOP &amp; SMiLE</b>&nbsp; will not be liable if any mishap happened.&nbsp;<a href="http://www.shopndsmile.com/">www.shopndsmile.com</a>&nbsp;retains the right to refuse any request made by you. If your order is accepted we will inform you by email and we will confirm the identity of the party which you have contracted with. This will usually be www.shopndsmile.com or may in some cases be a third party. Where a contract is made with a third party www.shopndsmile.com is not acting as either agent or principal and the contract is made between yourself and that third party and will be subject to the terms of sale which they supply you. When placing an order you undertake that all details you provide to us are true and accurate, that you are an authorized user of the credit or debit card used to place your order and that there are sufficient funds to cover the cost of the goods. The cost of foreign products and services may fluctuate. All prices advertised are subject to such changes.</p>\r\n<p>(a) Our Contract&nbsp;</p>\r\n<p>When you place an order, you will receive an acknowledgement e-mail confirming receipt of your order: this email will only be an acknowledgement and will not constitute acceptance of your order. A contract between&nbsp;<b>SHOP &amp; SMiLE</b>&nbsp;will not be formed until we send you confirmation by e-mail/telephone that the goods which you ordered have been dispatched to you. Only those goods listed in the confirmation e-mail sent at the time of dispatch will be included in the contract formed.</p>\r\n<p>(b) Pricing and Availability</p>\r\n<p>Whilst we try and ensure that all details, descriptions and prices which appear on this Website are accurate, errors may occur. If we discover an error in the price of any goods which you have ordered we will inform you of this as soon as possible and give you the option of reconfirming your order at the correct price or cancelling it. If we are unable to contact you we will treat the order as cancelled. If you cancel and you have already paid for the goods, you will receive a full refund.</p>\r\n<p>Delivery costs will be charged in addition in some cases; such additional charges are clearly displayed where applicable and included in the ''Total Cost''.</p>\r\n<p>(c) Payment&nbsp;</p>\r\n<p>Upon receiving your order we carry out a standard authorization check on your payment card to ensure there are sufficient funds to fulfil the transaction. Your card will be debited upon authorization being received. The monies received upon the debiting of your card shall be treated as a deposit against the value of the goods you wish to purchase. Once the goods have been dispatched and you have been sent a confirmation email the monies paid as a deposit shall be used as consideration for the value of goods you have purchased as listed in the confirmation email.</p>\r\n<p>Disclaimer of Liability</p>\r\n<p>The material displayed on this Website is provided without any guarantees, conditions or warranties as to its accuracy. Unless expressly stated to the contrary to the fullest extent permitted by law&nbsp;<a href="http://www.shopndsmile.com/">www.shopndsmile.com</a>&nbsp;and its suppliers, content providers and advertisers hereby expressly exclude all conditions, warranties and other terms which might otherwise be implied by statute, common law or the law of equity and shall not be liable for any damages whatsoever, including but without limitation to any direct, indirect, special, consequential, punitive or incidental damages, or damages for loss of use, profits, data or other intangibles, damage to goodwill or reputation, or the cost of procurement of substitute goods and services, arising out of or related to the use, inability to use, performance or failures of this Website or the Linked Sites and any materials posted thereon, irrespective of whether such damages were foreseeable or arise in contract, tort, equity, restitution, by statute, at common law or otherwise. This does not affect www.shopndsmile.com''s liability for death or personal injury arising from its negligence, fraudulent misrepresentation, and misrepresentation as to a fundamental matter or any other liability which cannot be excluded or limited under applicable law.</p>\r\n<p>Linking to this Website</p>\r\n<p>You may link to our home page, provided you do so in a way that is fair and legal and does not damage our reputation or take advantage of it, but you must not establish a link in such a way as to suggest any form of association, approval or endorsement on our part where none exists. You must not establish a link from any website that is not owned by you. This Website must not be framed on any other site, nor may you create a link to any part of this Website other than the home page. We reserve the right to withdraw linking permission without notice.</p>\r\n<p>Disclaimer as to ownership of trade marks, images of personalities and third party copyright</p>\r\n<p>Except where expressly stated to the contrary all persons (including their names and images), third party trademarks and content, services and/or locations featured on this Website are in no way associated, linked or affiliated with<a href="http://www.shopndsmile.com/">www.shopndsmile.com</a>&nbsp; and you should not rely on the existence of such a connection or affiliation. Any trade marks/names featured on this Website are owned by the respective trade mark owners. Where a trade mark or brand name is referred to it is used solely to describe or identify the products and services and is in no way an assertion that such products or services are endorsed by or connected to&nbsp;<b>SHOP &amp; SMiLE</b>.</p>\r\n<p>Indemnity</p>\r\n<p>You agree to indemnify, defend and hold harmless www.shopndsmile.com, its directors, officers, employees, consultants, agents, and affiliates, from any and all third party claims, liability, damages and/or costs (including, but not limited to, legal fees) arising from your use this Website or your breach of the Terms of Service.</p>\r\n<p>Variation</p>\r\n<p>www.shopndsmile.com shall have the right in its absolute discretion at any time and without notice to amend, remove or vary the Services and/or any page of this Website.</p>\r\n<p>Invalidity</p>\r\n<p>If any part of the Terms of Service is unenforceable (including any provision in which we exclude our liability to you) the enforceability of any other part of the Terms of Service will not be affected all other clauses remaining in full force and effect. So far as possible where any clause/sub-clause or part of a clause/sub-clause can be severed to render the remaining part valid, the clause shall be interpreted accordingly. Alternatively, you agree that the clause shall be rectified and interpreted in such a way that closely resembles the original meaning of the clause /sub-clause as is permitted by law.</p>\r\n<p>Complaints</p>\r\n<p>We operate a complaints handling procedure which we will use to try to resolve disputes when they first arise, please let us know if you have any complaints or comments.</p>\r\n<p>Waiver</p>\r\n<p>If you breach these conditions and we take no action, we will still be entitled to use our rights and remedies in any other situation where you breach these conditions.</p>\r\n<p><b>Content you submit at&nbsp;</b><b>SHOP &amp; SMiLE</b>&nbsp;</p>\r\n<p>All comments, visuals, videos and any other types of materials posted by fans on this site do not necessarily reflect the opinions or ideas of&nbsp;<b>SHOP &amp; SMiLE</b>. So its employees or affiliates, and&nbsp;<b>SHOP &amp; SMiLE</b>&nbsp;is not responsible for any such content. www.shopndsmile.com reserves the right to alter, crop, highlight, and/or repost on Facebook fan page photos and other content posted to this www.shopndsmile.com.</p>\r\n<p><b>Order acceptance</b></p>\r\n<p>The site reserves the right to refuse or cancel any order for any reason at any time. You will be notify by email as soon as possible to confirm receipt of your order,&nbsp;<b>SHOP &amp; SMiLE</b>&nbsp;shall contact you again to confirm details and therefore process the order. Our acceptance of your order will take place upon dispatch of product or products ordered. No act or omission of shopndsmile.com prior to the actual dispatch of the product(s) ordered will constitute acceptance of your order. You may asked to provide additional verifications or information, including but not limited to phone number and address, before we accept the order. In order to avoid any fraud with credit or debit cards, we reserve the right to obtain validation of your payment details before providing with the product and verify the personal information you shared with us. This verification can take the shape of an identity, place of residence or banking information check. The absence of an answer following such a demand will automatically cause the cancellation of the order.&nbsp; We reserve the right to proceed to direct cancellation of an order which we suspect a risk of fraudulent use of credit or debit card.</p>\r\n<p>&nbsp;Eligibility of Membership for&nbsp;<b>SHOP &amp; SMiLE</b>&nbsp;</p>\r\n<p>Use of this Site is available only to persons who can term legally binding contracts under applicable law. If you are a minor i.e. under the age of 18 years of age but at least 13 years of age, you may use this site only under the supervision of a parent or a legal guardian who agrees to be bound by these terms of use. If your age is below that of 18 years your parents or legal guardians can transact on behalf of you. Shopndsmile.com reserves the right to terminate your membership and refuse to provide you with the access of the site if shopndsmile.com discovers that you are under the age of 18 years. By using the services of shopndsmile.com you agree to be bound by the terms and conditions.&nbsp;</p>\r\n<p>Entire Agreement</p>\r\n<p>The above Terms of Service constitute the entire agreement of the parties and supersede any and all preceding and contemporaneous agreements between you and&nbsp;<a href="http://www.shopndsmile.com/">www.shopndsmile.com</a>. Any waiver of any provision of the Terms of Service will be effective only if in writing and signed by a Director of&nbsp;<a href="http://www.shopndsmile.com/">www.shopndsmile.com</a></p>', '2015-09-04 10:54:28', '2015-09-04 10:54:28', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL);
